    [],nt"num_tags": 56,nt"name": "annual-narrative-oyster-bay-national-wildlife-refuge-1972",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Oyster
    Bay National Wildlife Refuge outlines Refuge accomplishments during the 1972 calendar
    year. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover conditions during the year. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, mammals, raptors,
    fish, reptiles, and diseases- is also covered. The Refuge development and maintenance
    section discusses physical developments and vegetation control. The public relations
    section of the report describes recreational uses, Refuge visitors, Refuge participation,
    hunting, and violations. Items of interest, photographs, and newspaper articles
    are included.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
